 (29,8,'Donde colocas informacion invisible que ayuda a los robots indexar la pagina? ','En Template (Plantilla).','En cualquier lugar entre las etiquetas &#60;HTML>&#60;/HTML>. ','En los Metatags en la seccion HEAD.','En hoja de estilos',0,0,1,0),
 (29,9,'Porque es importante validar el codigo XHTML y CSS?','Para que DW te permita subir archivos al servidor.','Para verificar que el codigo esta conforme con los especificaciones del codigo.','Porque codigo sin validar puede hacer fallar y tronar el navegador.','Para formatearlo y facilitar su lectura por humanos.',0,1,0,0),
 (29,10,'Con que tecnologia conviene hacer un menu de vinculos facil de actualizar en todas las paginas del sitio?','Spry','Photoshop o Fireworks','Biblioteca','Imagen de Sustitucion (Roll-over)',0,0,1,0),
 (29,11,'Para que sirve la etiqueta IFRAME?','Para crear bordes con estilo 3D','Para hacer un texto parpadear','Para lograr hacer efectos especiales de CSS con JavaScript','Para desplegar un archivo  HTML dentro del otro',0,0,0,1),
 (29,12,'Con que tecnica puedes hacer un menu de vinculos usando elemento de formulario tipo lista?','Comportamiento Definir texto de contenedor','Menu de salto','Comportamiento Mostrar/Ocultar elementos','Barra de navegacion',0,1,0,0),
 (29,13,'Que intenta lograr a hacer Accesibilidad?','Hacer que los sitios de web se decargen rapido.','Hacer que los sitios web pueden ser navegados por personas descapacitadas.','Hacer que los imagenes se vean de buena calidad pero pequeos tamaos de los archivos','Hacer que el servidor detecte tipo y configuracion del navegador y cargue la hoja de estilo adecuada para desplegar el contenido con ajuste de presentacion.',0,1,0,0),
 (29,14,'Como se valida elementos de formulario?','Modificando los elementos con comportamientos.','Modificando propiedades de la etiqeuta FORM','Modificando la accion del boton para que verifique antes de enviar si los elementos estan rellenados correctamente.','Usando objetos Spry en lugar de elementos de formulario normales.',0,0,0,1),
