 (33,4,'Agrega un salto de lnea','<bl/>','<break/>','<enter/>','<br/>',0,0,0,1),
 (33,5,'La etiqueta <a> sirve para:','Establecer una asociacin entre la URL actual y el dominio del sitio en que e encuentra','Crear un vnculo con algn punto del mismo documento','Crear una liga entre dos documentos del mismo sitio','Hacer vnculos con pginas de otros dominios',0,1,1,1),
 (33,6,'Atributo de la etiqueta <a>','href','target','format','scope',1,1,0,0),
