 (14,20,'Comando para modificar la columna existencia al tipo decimal','    <font color=blue>alter table </font>movimientos<br> <font color=blue>add</font> existencia existencia <font color=blue>decimal</font>(8,2);    ','    <font color=blue>alter table</font> movimientos<br> <font color=blue>add</font> temporal <font color=blue>decimal</font>(8,2);    ','<font color=blue>select</font> * <font color=blue>from</font> movimientos','    <font color=blue>alter table</font> movimientos <font color=blue>change</font> existencia existencia <font color=blue>decimal</font>(8,2);    ',0,0,0,1),
