 (25,6,'La diferencia entre el m&eacute;todo post y get es:\r','Ninguna','  Que el m&eacute;todo get, muestra los valores que se env&iacute;an, mientras que post no los muestra.  ','El  m&eacute;todo get es mas r&aacute;pido','El m&eacute;todo post no aplica en linux',0,1,0,0),
 (25,7,'Cuando se invoca un Servlet desde la barra de direcciones el m&eacute;todo que se utiliza por omisi&oacute;n es:\r','post','init','get','destroy',0,0,1,0),
