INSERT INTO `temp` (`iddepartamental`,`numpregunta`,`pregunta`,`respuesta1`,`respuesta2`,`respuesta3`,`respuesta4`,`solucion1`,`solucion2`,`solucion3`,`solucion4`) VALUES 
 (14,1,'Como distingue una computadora una dato numrico de un dato tipo caracter?','Porque los  datos tipo carcter solo pueden ser letras','Los datos numricos no se escriben entre comilla simple  o comillas y  los de tipo carcter si','No puede distinguirlos','Los datos nmericos se escriben con un espacio entre ellos y los de tipo carcter no',0,1,0,0),
 (14,2,'Una variable ','Es una estructura de control','Una prueba de escritorio','Un diagrama de flujo','Un espacio reservado en la memoria',0,0,0,1),
 (14,3,'La estructura if se caracteriza por','Obligadamente siempre usar else ','Resolver si se cumple o no la condicin para realizar algo con base en esta decisin','Se usa para ingresar datos desde el teclado','Ser una estructura de control',0,1,0,1),
 (14,4,'Un if anidado es ','Un if  dentro de otro if','El else de otro if','No existe','Un acumulador de direcciones',1,0,0,0),
 (14,5,'El ciclo while se repite ?','Hasta que encuentra otro ciclo','Hasta que encuentra la instruccin break','Mientras la condicin que controla se cumpla','Solo si la condicion que controla no se cumple',0,1,1,0),
 (14,6,'Se usa para la creacin de ciclos','el while','el arreglo','la declaracion de variables','el for',1,0,0,1),
 (14,7,'La instruccin for','Permite crear ciclos ','Se conoce como arreglo','Solo se puede usar en funciones','Es una estructura de control',1,0,0,1),
 (14,8,'Un arreglo?','Puede almacenar varios valores','Utiliza un indice','una constante','Requiere botones.',1,1,0,0),
 (14,9,'Al finalizar el programa, cual es valor de A?<br/> <br/> num = 0;<br/>A = 10;<br/><font color=\'blue\'>while</font>( A <10){<br/><p  style=  margin: 1 30   align=  justify  >A = A + 1;<br/>}</p><font  color=\'blue\'>if</font> (A == 10){<br/><p style=  margin: 1  30   align=  justify  >A = A * A;</p>}<font color=\'blue\'>else</font>{<br/><p  style=  margin: 1 30   align=  justify  >A = A - 5;</p>}<br/><font  color=\'blue\'>while</font> (num < 5){<br/><p style=  margin: 1 30    align=  justify  >num = num + 1;</p>}<br/>document.write(A);<br/> ','10','97','105','100',0,0,0,1),
 (14,10,'En el programa anterior, cuantas veces se ejecuta el segundo while ?','1','5','3','4',0,1,0,0);
